using ObjectiveC;using System;using SharpSwift.Attributes;using System.Collections.Generic;namespace Foundation{    /// <summary>    /// NSHTTPCookieStorage implements a singleton object (shared instance) that manages storage of cookies. Each cookie is represented by an instance of the NSHTTPCookie class. As a rule, cookies are shared among all applications and are kept in sync across process boundaries. Session cookies (where the cookie object’s isSessionOnly method returns true) are local to a single process and are not shared.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/Foundation/Classes/NSHTTPCookieStorage_Class/index.html#//apple_ref/occ/cl/NSHTTPCookieStorage"/>    [iOSVersion(2)]    [Export("")]    public class NSHTTPCookieStorage : NSObject//, AnyObject, CVarArgType, Equatable, Hashable, NSObjectProtocol, Printable    {        public NSHTTPCookieStorage() { }        /// <summary>        /// Returns the shared cookie storage instance.        /// </summary>        [iOSVersion(2)]        [Export("sharedHTTPCookieStorage")]        public static NSHTTPCookieStorage SharedHTTPCookieStorage() { return default(NSHTTPCookieStorage); }                /// <summary>        /// Deletes the specified cookie from the cookie storage.        /// </summary>        /// <param name="aCookie">The cookie to delete.</param>        [iOSVersion(2)]        [Export("deleteCookie")]        public virtual void DeleteCookie(NSHTTPCookie aCookie) {  }                /// <summary>        /// Stores a specified cookie in the cookie storage if the cookie accept policy permits.        /// </summary>        /// <param name="aCookie">The cookie to store.</param>        [iOSVersion(2)]        [Export("setCookie")]        public virtual void SetCookie(NSHTTPCookie aCookie) {  }                /// <summary>        /// Adds an array of cookies to the receiver if the receiver’s cookie acceptance policy permits.        /// </summary>        /// <param name="cookies">The cookies to add.</param>        /// <param name="forURL">The URL associated with the added cookies.</param>        /// <param name="mainDocumentURL">The URL of the main HTML document for the top-level frame, if known. Can be nil. This URL is used to determine if the cookie should be accepted if the cookie accept policy is NSHTTPCookieAcceptPolicyOnlyFromMainDocumentDomain.</param>        [iOSVersion(2)]        [Export("setCookies")]        public virtual void SetCookies(AnyObject[] cookies, [Optional] NSURL forURL, [Optional] NSURL mainDocumentURL) {  }                /// <summary>        /// Returns all the cookie storage’s cookies that are sent to a specified URL.        /// </summary>        /// <param name="theURL">The URL to filter on.</param>        [iOSVersion(2)]        [Export("cookiesForURL")]        public virtual AnyObject[] CookiesForURL(NSURL theURL) { return default(AnyObject[]); }                /// <summary>        /// Returns all of the cookie storage’s cookies, sorted according to a given set of sort descriptors.        /// </summary>        /// <param name="sortOrder">The sort descriptors to use for sorting, as an array of NSSortDescriptor objects.</param>        [iOSVersion(5)]        [Export("sortedCookiesUsingDescriptors")]        public virtual AnyObject[] SortedCookiesUsingDescriptors(AnyObject[] sortOrder) { return default(AnyObject[]); }                /// <summary>        /// The cookie storage’s cookie accept policy.        /// </summary>        [iOSVersion(2)]        [Export("cookieAcceptPolicy")]        public NSHTTPCookieAcceptPolicy CookieAcceptPolicy { get; set; }                /// <summary>        /// The cookie storage’s cookies. (read-only)        /// </summary>        [iOSVersion(2)]        [Export("cookies")]        public AnyObject[] Cookies { get; private set; }    }    /// <summary>    /// NSHTTPCookieAcceptPolicy specifies the cookie acceptance policies implemented by the NSHTTPCookieStorage class.    /// </summary>    public enum NSHTTPCookieAcceptPolicy    {        /// <summary>        /// Accept all cookies. This is the default cookie accept policy.        /// </summary>        [iOSVersion(2)]        Always,        /// <summary>        /// Reject all cookies.        /// </summary>        [iOSVersion(2)]        Never,        /// <summary>        /// Accept cookies only from the main document domain.        /// </summary>        [iOSVersion(2)]        OnlyFromMainDocumentDomain,    }    /// <summary>    /// This notification is posted when the cookies stored in the NSHTTPCookieStorage instance have changed.    ///   In OS X, cookies are shared among applications, meaning this notification can be sent in response to another application’s actions. Cookies are not shared among applications in iOS.    ///   The notification object is the NSHTTPCookieStorage instance. This notification does not contain a userInfo dictionary.    /// </summary>    public class NSHTTPCookieManagerCookiesChangedNotification : NSNotification    {        public NSHTTPCookieManagerCookiesChangedNotification() : base("", null) { }    }    /// <summary>    /// This notification is posted when the acceptance policy of the NSHTTPCookieStorage instance has changed.    ///   In OS X, cookies are shared among applications, meaning this notification can be sent in response to another application’s actions. Cookies are not shared among applications in iOS.    ///   The notification object is the NSHTTPCookieStorage instance. This notification does not contain a userInfo dictionary.    /// </summary>    public class NSHTTPCookieManagerAcceptPolicyChangedNotification : NSNotification    {        public NSHTTPCookieManagerAcceptPolicyChangedNotification() : base("", null) { }    }}